import React from 'react';
import './home.css'
import {
  MDBBtn,
  MDBNavbarLink
} from 'mdb-react-ui-kit';
import Header from '../../components/header/header';

const Home = () => {

  return (
    <div>
      <Header />
      <div className="featured-services">
        <div className='featured-services-header'>
          <h1>Featured Services</h1>
          <MDBNavbarLink>
            <MDBBtn
              rounded className='mx-2' color='black'
              href='#ourservices'
            >
              All Services
            </MDBBtn>
          </MDBNavbarLink>
        </div>

          {/* Add featured service drop down here with descriptions 
          exmaple services include : basic mani, basic pedi, spa pedi, and deuluxe pedi */}
        <div>
          <h3>Service 1 ------------------ +</h3>
          <h3>Service 2 ------------------ +</h3>
          <h3>Service 3 ------------------ +</h3>
          <h3>Service 4 ------------------ +</h3>
        </div>
      </div>

      <div className="about-us">
        <div className="about-us-header">
            <h1>More About our Business</h1>
        </div>

        <div className="aboutus-img1">
        <img src="/images/image1.avif" alt=""></img>
        </div>

        <div className="aboutus-sec2">
        <img src="/images/image3.avif" alt=""></img>
        <p>Our small business-owned nail salon is run by three highly skilled nail technicians with years of industry expertise. They specialize in a wide range of nail care services such as SNS, crylic, gel, and so on.</p>
        <p>Their goal is to provide their clients with the best possible service while maintaining the highest standard of sanitization.</p>
        <p>Explore our gallery to see some of their greatest works over the years, along with those of other incredibly skilled nail technicians.</p>
        <MDBNavbarLink>
            <MDBBtn
              outline rounded className='mx-2 custom-hover' color='black'
              href='gallery'
            >
              Gallery
            </MDBBtn>
          </MDBNavbarLink>
        </div>
      </div>

       <div className="our-services">
  <style>
    {`
    // .service-link {
    //   text-decoration: none;
    //   position: relative;
    //   transition: color 0.3s;
    // }

    // .service-link::after {
    //   content: '';
    //   position: absolute;
    //   bottom: -5px; 
    //   left: 0;
    //   width: 0;
    //   height: 2px;
    //   background-color: black; 
    //   transition: width 0.3s;
    // }

    // .service-link:hover {
    //   color: black; 
    // }

    // .service-link:hover::after {
    //   width: 100%;
    //   text-align: 
    // }

    .service-link img{
      transition: transform 0.3s;
    }

    .service-link:hover img{
      transform: scale(1.1);
    }
    `}
  </style>

  <h1 style={{ textAlign: "center", margin: 80 }}>Our Services</h1>

  <div
    id='ourservices'
    style={{
    display: 'grid',
    gridTemplateColumns: "auto auto auto",
    textAlign:'center',
    }}
  >
 <MDBNavbarLink href="services" className="service-link">
      <div>
        <img
          src="/images/mani-icon.png"
          alt="mani-icon"
          style={{ width: "50%", borderRadius: "50%" }}
        />
        <h3 style={{marginTop:30}}>Manicure</h3>
      </div>
    </MDBNavbarLink> 

    <MDBNavbarLink href="/services#pedi-treatments" className="service-link">
      <div>
        <img
          src="/images/pedi-icon.png"
          alt="pedi-icon"
          style={{ width: "50%", borderRadius: "50%" }}
        />
        <h3 style={{marginTop:30}}>Pedicure</h3>
      </div>
    </MDBNavbarLink> 

    <MDBNavbarLink href="services" className="service-link">
      <div>
        <img
          src="/images/wax-icon.png"
          alt="wax-icon"
          style={{ width: "50%", borderRadius: "50%" }}
        />
        <h3 style={{marginTop:30}}>Wax/ Hair Removal</h3>
      </div>
    </MDBNavbarLink>

    <MDBNavbarLink href="services" className="service-link">
      <div>
        <img
          src="/images/gel.png"
          alt="gelmachine-icon"
          style={{ width: "50%", borderRadius: "50%" }}
        />
        <h3 style={{marginTop:30}}>Gel</h3>
      </div>
    </MDBNavbarLink>

    <MDBNavbarLink href="services" className="service-link">
      <div>
        <img
          src="/images/full set.png"
          alt="fullset-icon"
          style={{ width: "50%", borderRadius: "50%" }}
        />
        <h3 style={{marginTop:30}}>Full Sets</h3>
      </div>
    </MDBNavbarLink>

    <MDBNavbarLink href="services" className="service-link">
      <div>
        <img
          src="/images/fillin.png"
          alt="fillins-icon"
          style={{ width: "50%", borderRadius: "50%" }}
        />
        <h3 style={{marginTop:30}}>Fill Ins</h3>
      </div>
    </MDBNavbarLink>

    <MDBNavbarLink href="services" className="service-link">
      <div>
        <img
          src="/images/kidhands.png"
          alt="kidhands-icon"
          style={{ width: "50%", borderRadius: "50%" }}
        />
        <h3 style={{marginTop:30}}>Kid Services</h3>
      </div>
    </MDBNavbarLink>

  </div>
  <MDBNavbarLink style={{padding: 100, textAlign: 'center'}}>
            <MDBBtn
              outline rounded className='mx-2 custom-hover' color='black'
              href='services'
              style={{ fontSize: 15}}
            >
              Browse Services
            </MDBBtn>
          </MDBNavbarLink>


</div>

    </div>
  );
}

export default Home;
